import React from "react";
import "./Cart.css";

function Cart() {
  return (
    <div className="cart">
      <div className="cart__items">
        <img
          src="https://www.disruptivestatic.com/wp-content/uploads/2018/10/Screen-Shot-2018-10-29-at-11.50.03-AM-450x96.png"
          alt="Advertisement"
          className="cart__ad"
        />

        <h2 className="cart__title">Your Shopping Cart</h2>
      </div>

      <div className="cart__checkout">
        <h2>Subtotal and proceed to checkout</h2>
      </div>
    </div>
  );
}

export default Cart;
